import "./ExpenseItem.css";

export const ExpenseItem = ({ exp }) => {
  const month = exp.date.toLocaleString("en-US", { month: "long" });
  const day = exp.date.toLocaleString("en-US", { day: "2-digit" });
  const year = exp.date.getFullYear();
  return (
    <div className="expense-item">
      <div>{month}</div>
      <div></div>
      <div></div>
      <div className="expense-item__description">
        <h2>{exp.title}</h2>
        <div className="expense-item__price">${exp.amount}</div>
      </div>
    </div>
  );
};
